import React from "react";

//Material UI
import { Typography, Grid } from "@material-ui/core";

const Footer = () => {
  return (
    <Grid
      container
      justify="space-between"
      alignItems="center"
      xs={12}
      style={{
        backgroundColor: "#00539c",
      }}
    >
      <Grid item alignContent="center" xs={11} md={3}>
        <Typography
          style={{
            color: "white",
            fontFamily: "lobster",
            margin: "33px",
            fontSize: "22px",
            textShadow: "5px 5px 10px blue, 5px 5px 10px cyan",
          }}
          align="center"
          variant="h6"
        >
          YousFitness - Clothing
        </Typography>
      </Grid>
      <Grid item xs={11} md={5}>
        Footer Links
      </Grid>
      <Grid item xs={11} md={4}>
        Socials
      </Grid>
    </Grid>
  );
};

export default Footer;
